column2:
.{{= name }} {
    position: relative;
    padding: 0.5rem;
    color: #333;
    background-color: #888;
    text-overflow: ellipsis;
    overflow: hidden;
}

.{{= name }} {
    border-top: 1px solid #333;
}

.{{= name }}:hover {
    background-color: #666;
}

.{{= name }}:active {
    top: 1px;
    background-color: lightyellow !important;
}

.{{= name }}.selected {
    background-color: #333;
    color: #aaa;
}

var w = $('#'+id);

function display() {
    var val = field.value;

    if (val == null) {
        val = 'NULL';
    }

    else if (val == '') {
        val = '____';
    }

    w.find('.display').html(val);
    w.find('input').val(val);

    w.removeClass('saving')
    .removeClass('editing')
    .addClass('displaying');

    //w.find('.edit input').prop('disabled', false);
}
display();

function edit() {
    w.removeClass('displaying')
    .removeClass('saving')
    .addClass('editing');
    w.find('input').focus();
}


function save(saving_as_null) {

    w.removeClass('displaying')
    .removeClass('editing')
    .addClass('saving');

    //w.find('.edit input').prop('disabled', true);

    var old_value = field.value;

    // save
    if (saving_as_null) {
        field.set(null);
    }
    else {
        field.set(w.find('input').val());
    }

    field.update().then(function() {
        w.trigger('status', ['Saved', 'success']);
        w.trigger('form_field_save');
        display();

    }).catch(function(error) {
        field.set(old_value);
        w.trigger('status', ['Failed save', 'fail']);
        display();
    });
}


// EVENT BINDINGS
w.find('.save').on('click', save.bind(this, false));
w.find('.save_as_null').on('click', save.bind(this, true));
w.find('.display').on('click', edit);
w.find('.cancel').on('click', display);
w.find('input').on('keyup', function(e) {
    if (e.keyCode == 27) {
        display();
    }
    if (e.keyCode == 13) {
        save(false);
    }
});

var w = $("#"+id);
/*
var schema_name = datum.relation.schema.name;
var relation_name = datum.relation.name;
*/
var rel_name = datum.relation.schema.name + '.' + datum.relation.name;


datum.fields().forEach(function(field) {
    w.append('<td>' + widget('semantics/form_field', field) + '</td>');
});

var del_button = $('<td><button>Delete</button></td>');
w.append(del_button);
del_button.on('click', function() {
    datum.delete().then(function() {
        w.trigger('status', ['Row deleted on ' + rel_name, 'success']);
        w.remove();
    }).catch(function() {
        w.trigger('status', ['Failed delete on ' + rel_name, 'fail']);
    });
});

table.{{= name }},
table.{{= name }} td,
table.{{= name }} th,
table.{{= name }} tr {
    border: 1px solid #666;
    border-collapse: collapse;
    padding: 0.5rem;
}

.{{= name }} .no_border {
    border: none;
}

var w = $("#"+id);


row.relation.row(row.pk_column_name, row.pk_value)
.then(function(row) {
    var rel_name = row.relation.schema.name + '.' + row.relation.name;

    row.columns.forEach(function(col) {
        w.append(
            '<tr>' +
            	'<td>' + 
		            widget('semantics/form_label', row.field(col.name)) + 
        	    '</td>' +
            	'<td>' + 
		            widget('semantics/form_field', row.field(col.name)) + 
	            '</td>' +
            '</tr>');
    });


    w.find('.delete_row').on('click', function() {
        if (confirm('Are you sure you\'d like to delete this row?')) {
            row.delete()
            .then(function() {
                w.trigger('close_tab_self');
                w.trigger('status', ['Row deleted from ' + rel_name, 'success']);
                w.trigger('row_detail_delete');
                w.trigger('done');
                w.remove();
            })
            .catch(function() {
                w.trigger('status', ['Failed delete on ' + rel_name, 'fail']);
            });
        }
    });

    w.find('.save_row').on('click', function() {
        row.update()
        .then(function() {
            return;
        })
        .catch(function() {
            alert('failed to save '+rel_name);
        });
    });

});

.{{= name }} {
} 

.{{= name }}:not(.displaying) > .display {
    display: none;
}

.{{= name }} > .display:hover {
    text-decoration: underline;
    cursor: hand;
    cursor: pointer;
}

.{{= name }}:not(.editing) > .edit {
    display: none;
}

.{{= name }}:not(.saving) > .save {
    display: none;
}

var w = $("#"+id);

var label = row.relation.schema.name + '.' + row.relation.name + ': ';

if (typeof row.get('name') != 'undefined') label += row.get('name');
else if (typeof row.get('title') != 'undefined') label += row.get('title');
else if (typeof row.get('path') != 'undefined') label += row.get('path');
else if (typeof row.get('mimetype') != 'undefined') label += row.get('mimetype');
else if (typeof row.get('url_pattern') != 'undefined') label += row.get('url_pattern');
else label += row.pk_value;

w.html(label);

var w = $('#'+id);

w.data('datum', row);
w.data('row', row);

// Assign all triggers
['click'].forEach(function(trig) {
    w.on(trig, function(e) {
        e.stopPropagation();
        w.trigger('list_item_' + trig, [row, w]);
    });
});
